-- ----------------------------
-- View structure for completeinsuranceoverview
-- ----------------------------
DROP VIEW IF EXISTS `completeinsuranceoverview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `completeinsuranceoverview` AS select `ip`.`Insurer` AS `Insurer`,`ip`.`ProductName` AS `ProductName`,`ip`.`Type` AS `Type`,`fm`.`Name` AS `Name`,`fm`.`IDNumber` AS `IDNumber`,`i`.`BankAccountLastDigits` AS `BankAccountLastDigits`,`i`.`PolicyID` AS `PolicyID`,`i`.`EffectiveDate` AS `EffectiveDate`,`i`.`Policyholder` AS `Policyholder`,(case when (curdate() < `i`.`EffectiveDate`) then 'Not in force' when ((`i`.`EffectiveDate` + interval `ip`.`Term` month) >= curdate()) then 'In effect' else 'Expired' end) AS `status`,`ip`.`PaymentAmount` AS `PaymentAmount`,`ip`.`PaymentFrequency` AS `PaymentFrequency`,(`ip`.`PaymentFrequency` * `ip`.`NumberOfPayments`) AS `Totalpaymenttime`,`ip`.`Term` AS `Term`,`ip`.`CoverageAmount` AS `CoverageAmount`,`cr`.`ClaimNumber` AS `ClaimNumber`,`cr`.`ClaimAmount` AS `ClaimAmount`,`cr`.`ClaimTime` AS `ClaimTime`,`cr`.`Reason` AS `Reason` from (((`insurancepolicy` `i` join `familymember` `fm` on((`i`.`FamilyMemberID` = `fm`.`IDNumber`))) join `insuranceproduct` `ip` on(((`i`.`Insurer` = `ip`.`Insurer`) and (`i`.`ProductName` = `ip`.`ProductName`)))) left join `claimsrecord` `cr` on((`i`.`PolicyID` = `cr`.`PolicyID`)));

-- ----------------------------
-- View structure for paymentdetails
-- ----------------------------
DROP VIEW IF EXISTS `paymentdetails`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `paymentdetails` AS select `combined`.`PolicyID` AS `PolicyID`,`combined`.`Name` AS `Name`,`combined`.`ProductName` AS `ProductName`,`combined`.`NextPaymentdata` AS `NextPaymentdata`,`combined`.`PaymentAmount` AS `PaymentAmount`,`combined`.`EmailAddress` AS `EmailAddress` from (select `p`.`PolicyID` AS `PolicyID`,`p`.`Name` AS `Name`,`p`.`ProductName` AS `ProductName`,`p`.`NextPaymentdata` AS `NextPaymentdata`,`p`.`PaymentAmount` AS `PaymentAmount`,`fm`.`EmailAddress` AS `EmailAddress` from (`policyview` `p` join `familymember` `fm` on((`fm`.`Name` = `p`.`Name`))) where ((`p`.`NextPaymentdata` is not null) and (`p`.`NextPaymentdata` between curdate() and (curdate() + interval 1 month)))) `combined` order by `combined`.`NextPaymentdata`;

-- ----------------------------
-- View structure for pdfview
-- ----------------------------
DROP VIEW IF EXISTS `pdfview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `pdfview` AS select `insurancepolicy`.`PolicyID` AS `PolicyID`,`insurancepolicy`.`PDFContent` AS `PDFContent` from `insurancepolicy`;

-- ----------------------------
-- View structure for policyview
-- ----------------------------
DROP VIEW IF EXISTS `policyview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `policyview` AS select `i`.`PolicyID` AS `PolicyID`,`fm`.`Name` AS `Name`,`i`.`Insurer` AS `Insurer`,`ip`.`Type` AS `Type`,`ip`.`CoverageAmount` AS `CoverageAmount`,`i`.`ProductName` AS `ProductName`,(case when (((timestampdiff(DAY,`i`.`FirstPaymentdata`,curdate()) DIV `ip`.`PaymentFrequency`) + 1) > `ip`.`NumberOfPayments`) then NULL else (`i`.`FirstPaymentdata` + interval (`ip`.`PaymentFrequency` * ((timestampdiff(DAY,`i`.`FirstPaymentdata`,curdate()) DIV `ip`.`PaymentFrequency`) + 1)) day) end) AS `NextPaymentdata`,`ip`.`PaymentAmount` AS `PaymentAmount`,(case when (curdate() < `i`.`EffectiveDate`) then 'Not in force' when ((`i`.`EffectiveDate` + interval `ip`.`Term` month) >= curdate()) then 'In effect' else 'Expired' end) AS `status` from ((`insurancepolicy` `i` join `familymember` `fm` on((`i`.`FamilyMemberID` = `fm`.`IDNumber`))) join `insuranceproduct` `ip` on(((`i`.`Insurer` = `ip`.`Insurer`) and (`i`.`ProductName` = `ip`.`ProductName`)))) order by (`NextPaymentdata` is null),(case when (((timestampdiff(DAY,`i`.`FirstPaymentdata`,curdate()) DIV `ip`.`PaymentFrequency`) + 1) > `ip`.`NumberOfPayments`) then NULL else (`i`.`FirstPaymentdata` + interval (`ip`.`PaymentFrequency` * ((timestampdiff(DAY,`i`.`FirstPaymentdata`,curdate()) DIV `ip`.`PaymentFrequency`) + 1)) day) end);

-- ----------------------------
-- View structure for recentpolicy
-- ----------------------------
DROP VIEW IF EXISTS `recentpolicy`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `recentpolicy` AS select `upcoming`.`PolicyID` AS `PolicyID`,`upcoming`.`Name` AS `Name`,`upcoming`.`Insurer` AS `Insurer`,`upcoming`.`Type` AS `Type`,`upcoming`.`CoverageAmount` AS `CoverageAmount`,`upcoming`.`ProductName` AS `ProductName`,`upcoming`.`NextPaymentdata` AS `NextPaymentdata`,`upcoming`.`PaymentAmount` AS `PaymentAmount`,`upcoming`.`status` AS `status` from (select `i`.`PolicyID` AS `PolicyID`,`fm`.`Name` AS `Name`,`i`.`Insurer` AS `Insurer`,`ip`.`Type` AS `Type`,`ip`.`CoverageAmount` AS `CoverageAmount`,`i`.`ProductName` AS `ProductName`,if(((((to_days(curdate()) - to_days(`i`.`FirstPaymentdata`)) DIV `ip`.`PaymentFrequency`) + 1) > `ip`.`NumberOfPayments`),NULL,(`i`.`FirstPaymentdata` + interval ((((to_days(curdate()) - to_days(`i`.`FirstPaymentdata`)) DIV `ip`.`PaymentFrequency`) + 1) * `ip`.`PaymentFrequency`) day)) AS `NextPaymentdata`,`ip`.`PaymentAmount` AS `PaymentAmount`,(case when (curdate() < `i`.`EffectiveDate`) then 'Not in force' when ((`i`.`EffectiveDate` + interval `ip`.`Term` month) >= curdate()) then 'In force' else 'Expired' end) AS `status` from ((`insurancepolicy` `i` join `familymember` `fm` on((`i`.`FamilyMemberID` = `fm`.`IDNumber`))) join `insuranceproduct` `ip` on(((`i`.`Insurer` = `ip`.`Insurer`) and (`i`.`ProductName` = `ip`.`ProductName`)))) where ((((to_days(curdate()) - to_days(`i`.`FirstPaymentdata`)) DIV `ip`.`PaymentFrequency`) + 1) <= `ip`.`NumberOfPayments`)) `upcoming` where (`upcoming`.`NextPaymentdata` between curdate() and (curdate() + interval 1 month)) union all select `a`.`PolicyID` AS `PolicyID`,`a`.`Name` AS `Name`,`a`.`Insurer` AS `Insurer`,`a`.`Type` AS `Type`,`a`.`CoverageAmount` AS `CoverageAmount`,`a`.`ProductName` AS `ProductName`,`a`.`NextPaymentdata` AS `NextPaymentdata`,`a`.`PaymentAmount` AS `PaymentAmount`,`a`.`status` AS `status` from (select `upcoming_inner`.`PolicyID` AS `PolicyID`,`upcoming_inner`.`Name` AS `Name`,`upcoming_inner`.`Insurer` AS `Insurer`,`upcoming_inner`.`Type` AS `Type`,`upcoming_inner`.`CoverageAmount` AS `CoverageAmount`,`upcoming_inner`.`ProductName` AS `ProductName`,`upcoming_inner`.`NextPaymentdata` AS `NextPaymentdata`,`upcoming_inner`.`PaymentAmount` AS `PaymentAmount`,`upcoming_inner`.`status` AS `status` from (select `i`.`PolicyID` AS `PolicyID`,`fm`.`Name` AS `Name`,`i`.`Insurer` AS `Insurer`,`ip`.`Type` AS `Type`,`ip`.`CoverageAmount` AS `CoverageAmount`,`i`.`ProductName` AS `ProductName`,if(((((to_days(curdate()) - to_days(`i`.`FirstPaymentdata`)) DIV `ip`.`PaymentFrequency`) + 1) > `ip`.`NumberOfPayments`),NULL,(`i`.`FirstPaymentdata` + interval ((((to_days(curdate()) - to_days(`i`.`FirstPaymentdata`)) DIV `ip`.`PaymentFrequency`) + 1) * `ip`.`PaymentFrequency`) day)) AS `NextPaymentdata`,`ip`.`PaymentAmount` AS `PaymentAmount`,(case when (curdate() < `i`.`EffectiveDate`) then 'Not in force' when ((`i`.`EffectiveDate` + interval `ip`.`Term` month) >= curdate()) then 'In force' else 'Expired' end) AS `status` from ((`insurancepolicy` `i` join `familymember` `fm` on((`i`.`FamilyMemberID` = `fm`.`IDNumber`))) join `insuranceproduct` `ip` on(((`i`.`Insurer` = `ip`.`Insurer`) and (`i`.`ProductName` = `ip`.`ProductName`)))) where ((((to_days(curdate()) - to_days(`i`.`FirstPaymentdata`)) DIV `ip`.`PaymentFrequency`) + 1) <= `ip`.`NumberOfPayments`)) `upcoming_inner` where (`upcoming_inner`.`NextPaymentdata` > curdate()) order by `upcoming_inner`.`NextPaymentdata` limit 3) `a` where exists(select 1 from (select (`i`.`FirstPaymentdata` + interval ((((to_days(curdate()) - to_days(`i`.`FirstPaymentdata`)) DIV `ip`.`PaymentFrequency`) + 1) * `ip`.`PaymentFrequency`) day) AS `NextPaymentdate` from (`insurancepolicy` `i` join `insuranceproduct` `ip` on(((`i`.`Insurer` = `ip`.`Insurer`) and (`i`.`ProductName` = `ip`.`ProductName`)))) where ((((to_days(curdate()) - to_days(`i`.`FirstPaymentdata`)) DIV `ip`.`PaymentFrequency`) + 1) <= `ip`.`NumberOfPayments`)) `b` where (`b`.`NextPaymentdate` between curdate() and (curdate() + interval 1 month))) is false;

-- ----------------------------
-- View structure for recommendedinterface
-- ----------------------------
DROP VIEW IF EXISTS `recommendedinterface`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `recommendedinterface` AS select `fm`.`Name` AS `Name`,`ip`.`Insurer` AS `Insurer`,`ip`.`ProductName` AS `ProductName`,`ip`.`Type` AS `Type`,`ip`.`Term` AS `Term` from (((select `i`.`FamilyMemberID` AS `FamilyMemberID`,`ip`.`Type` AS `Type`,(sum(`ip`.`CoverageAmount`) / sum((`ip`.`PaymentAmount` * `ip`.`NumberOfPayments`))) AS `insurance_cost_efficiency` from (`insurancepolicy` `i` join `insuranceproduct` `ip` on(((`i`.`Insurer` = `ip`.`Insurer`) and (`i`.`ProductName` = `ip`.`ProductName`)))) group by `i`.`FamilyMemberID`,`ip`.`Type`) `f` join `insuranceproduct` `ip` on((`f`.`Type` = `ip`.`Type`))) join `familymember` `fm` on((`fm`.`IDNumber` = `f`.`FamilyMemberID`))) where (`f`.`insurance_cost_efficiency` < (`ip`.`CoverageAmount` / (`ip`.`PaymentAmount` * `ip`.`NumberOfPayments`))) order by `fm`.`Name`,`ip`.`Type`;

-- ----------------------------
-- View structure for statistics
-- ----------------------------
DROP VIEW IF EXISTS `statistics`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `statistics` AS select `familymember`.`Name` AS `Name`,`familymember`.`IDNumber` AS `IDNumber`,sum((`insuranceproduct`.`PaymentAmount` * `insuranceproduct`.`NumberOfPayments`)) AS `TotalCost`,sum(`insuranceproduct`.`CoverageAmount`) AS `TotalCoverage`,count(`insurancepolicy`.`PolicyID`) AS `PolicyCount` from ((`familymember` join `insurancepolicy` on((`familymember`.`IDNumber` = `insurancepolicy`.`FamilyMemberID`))) join `insuranceproduct` on(((`insurancepolicy`.`Insurer` = `insuranceproduct`.`Insurer`) and (`insurancepolicy`.`ProductName` = `insuranceproduct`.`ProductName`)))) where ((`insurancepolicy`.`EffectiveDate` + interval `insuranceproduct`.`Term` month) > curdate()) group by `familymember`.`Name`,`familymember`.`IDNumber`;

-- ----------------------------
-- View structure for total_statistics
-- ----------------------------
DROP VIEW IF EXISTS `total_statistics`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `total_statistics` AS select sum((`insuranceproduct`.`PaymentAmount` * `insuranceproduct`.`NumberOfPayments`)) AS `TotalCost`,sum(`insuranceproduct`.`CoverageAmount`) AS `TotalCoverage`,count(`insurancepolicy`.`PolicyID`) AS `PolicyCount` from ((`familymember` join `insurancepolicy` on((`familymember`.`IDNumber` = `insurancepolicy`.`FamilyMemberID`))) join `insuranceproduct` on(((`insurancepolicy`.`Insurer` = `insuranceproduct`.`Insurer`) and (`insurancepolicy`.`ProductName` = `insuranceproduct`.`ProductName`)))) where ((`insurancepolicy`.`EffectiveDate` + interval `insuranceproduct`.`Term` month) > curdate());

